import React from "react";
import "../sass/main.scss";

const Search = () => {
  return (
    <div className="container">
      <script
        async
        src="https://cse.google.com/cse.js?cx=ce5974f4ca9842e6f"
      ></script>
      <div class="gcse-search"></div>
    </div>
  );
};

export default Search;
